import React from "react";
import human from "../../../Image/human.jpg";
import "./Profil.css";
import ListProfile from "./ListProfile";

class Profil extends React.Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {
    return (
      <div className="wrapp">

          <div class="dropdown">
  <button class="btn btn-secondary" style={{transition: "2s"}} type="button" id="dropdownMenu2" data-toggle="dropdown" aria-haspopup="true" aria-expanded="false">
  <a class="navbar-brand" href="##">
            <img className="image-profile" src={human} width="50" height="50" alt="" />
          </a>
  </button>
  <div class="dropdown-menu" aria-labelledby="dropdownMenu2">
    <button class="dropdown-item" type="button">Action</button>
    <button class="dropdown-item" type="button">Another action</button>
    <button class="dropdown-item" type="button">Something else here</button>
  </div>
</div>
        <div class="form-group has-search">
          <span class="fa fa-search form-control-feedback"></span>
          <input
            type="text"
            class="form-control shadow-none"
            placeholder="Search Your Contact . . ."
          />
        </div>
        <div className="list-profile">
          <ListProfile />
        </div>
      </div>
    );
  }
}

export default Profil;
